import { 
    ChakraProvider,
    Heading,
    Box,
    Center,
    Image
} from '@chakra-ui/react'

export const Header = () =>{
    return(
        
        <Box backgroundColor='#22074C' padding='15px'>
        <Center>

        <Image   boxSize='80px'
    objectFit='cover' src='https://hermes.digitalinnovation.one/assets/diome/logo-minimized.png' alt='logo dio minimizada' />

        </Center>
        </Box>
        
    )
}
